/*Table structure for table `chat` */

DROP TABLE IF EXISTS `chat`;

CREATE TABLE `chat` (
  `chat` varchar(2000) NOT NULL,
  `msgby` varchar(200) NOT NULL,
  `msgto` varchar(200) NOT NULL,
  `id` bigint(20) NOT NULL auto_increment,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `chat` */

insert  into `chat`(`chat`,`msgby`,`msgto`,`id`) values (' hi mandeep','manjit','mandeep',1),(' hello world','manjit','mandeep',2),(' hi hi','manjit','mandeep',3);

/*Table structure for table `chatroom` */

DROP TABLE IF EXISTS `chatroom`;

CREATE TABLE `chatroom` (
  `userto` varchar(200) NOT NULL,
  `chat` varchar(2000) NOT NULL,
  `id_c` bigint(20) NOT NULL auto_increment,
  PRIMARY KEY  (`id_c`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `chatroom` */

/*Table structure for table `newsfield` */

DROP TABLE IF EXISTS `newsfield`;

CREATE TABLE `newsfield` (
  `username` varchar(200) NOT NULL,
  `status` varchar(2000) default NULL,
  `id` bigint(20) NOT NULL auto_increment,
  `photo` longblob,
  PRIMARY KEY  (`id`)
